import React, { useState } from 'react';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <nav className="bg-green-700 shadow-lg">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between h-16">
          <div className="flex-shrink-0 flex items-center">
            <a href="#" className="text-white text-2xl font-bold">AgriLogo</a>
          </div>
          <div className="hidden md:flex space-x-8 items-center">
            <a href="#" className="text-white hover:text-green-300">Home</a>
            <a href="#" className="text-white hover:text-green-300">About</a>
            <a href="#" className="text-white hover:text-green-300">Services</a>
            <a href="#" className="text-white hover:text-green-300">Contact</a>
          </div>
          <div className="flex items-center">
            <a href="#" className="text-green-700 hover:text-green-900 bg-white px-4 py-2 border border-white rounded">Login</a>
          </div>
          <div className="-mr-2 flex md:hidden">
            <button
              type="button"
              className="inline-flex items-center justify-center p-2 rounded-md text-white hover:text-green-300 focus:outline-none"
              aria-controls="mobile-menu"
              aria-expanded={isOpen ? 'true' : 'false'}
              onClick={toggleMenu}
            >
              <svg className="h-6 w-6" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 6h16M4 12h16m-7 6h7" />
              </svg>
            </button>
          </div>
        </div>
      </div>
      <div className={`${isOpen ? '' : 'hidden'} md:hidden`} id="mobile-menu">
        <div className="px-2 pt-2 pb-3 space-y-1 sm:px-3">
          <a href="#" className="text-white hover:text-green-300 block px-3 py-2 rounded-md text-base font-medium">Home</a>
          <a href="#" className="text-white hover:text-green-300 block px-3 py-2 rounded-md text-base font-medium">About</a>
          <a href="#" className="text-white hover:text-green-300 block px-3 py-2 rounded-md text-base font-medium">Services</a>
          <a href="#" className="text-white hover:text-green-300 block px-3 py-2 rounded-md text-base font-medium">Contact</a>
          <a href="#" className="text-white hover:text-green-300 block px-3 py-2 rounded-md text-base font-medium">Login</a>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
